import React from 'react';
import PropTypes from 'prop-types';

/**
 * Hasta la version 16.8 -> Class Component - Statefull components
 * Desde la version 16.8 -> Funtional Components - Statelles components (Hacks)
 */

const Banner = ({ title, onClick, mouseOver, mouseOut }) => {
  return (
    <div onClick={onClick} onMouseOut={mouseOut} onMouseOver={mouseOver}>
      <h1>{title}</h1>
    </div>
  );
};

Banner.prototype = {
  title: PropTypes.string.isRequire
};

export default Banner;
